public void testAddingAndRemovingModulesWhenIgnoresChange() throws Exception {
    configConfirmationForYesAnswer();

    VirtualFile p1 = createModulePom("project1",
                                     "<groupId>test</groupId>" +
                                     "<artifactId>project1</artifactId>" +
